import React from "react";
import Home from '../Pages/Home'
import HomeGestionRoles from '../Pages/HomeGestionRoles'
import BuscarRol from "../Pages/BuscarRol";

import {BrowserRouter,Route } from 'react-router-dom'
function App(){
    return (
        <BrowserRouter>
        <Route exact path='/home' component={Home}/>
        <Route exact path='/home/gestionRoles' component={HomeGestionRoles}/>
        <Route exact path='/home/gestionRoles' component={BuscarRol}/>
        </BrowserRouter>
    )

} 
export default App
